import { Box, Typography } from "@mui/material";
import React from "react";

function Blogs() {
  return (
    <Box
      sx={{
        width: "100%",
        height: "500px",
        backgroundColor: "yellow",
      }}
    >
        <Typography>
            Blogs
        </Typography>
    </Box>
  );
}

export default Blogs;
